import React from "react";
import { Col, Row, Container } from "../components/Grid";

const Receipts = () => {
  return (
    <Container fluid>
      <h1>Order history</h1>
      <br />
      <a href="/home">Home</a>
      <p>receipts here</p>
    </Container>
  );
};

export default Receipts;
